#[cfg(feature = "32_bit_limbs")]
#[test]
fn test_limbs_invert_limb() {
    let test = |x: Limb, inv: Limb| {
        assert_eq!(limbs_invert_limb(x), inv);
    };
    test(0x8000_0000, u32::MAX);
    test(0x8000_0001, 0xffff_fffc);
    test(0x8000_0002, 0xffff_fff8);
    test(0x89ab_cdef, 0xdc08_767e);
    test(0xffff_fffd, 3);
    test(u32::MAX - 1, 2);
    test(u32::MAX, 1);
}

#[cfg(feature = "32_bit_limbs")]
#[test]
fn test_limbs_div_limb_mod_and_limbs_div_limb_in_place_mod() {
    let test = |ns: &[Limb], d: Limb, q: Vec<Limb>, r: Limb| {
        let (q_alt, r_alt) = limbs_div_limb_mod(ns, d);
        assert_eq!(q_alt, q);
        assert_eq!(r_alt, r);
        let old_ns = ns;

        let mut ns = old_ns.to_vec();
        assert_eq!(limbs_div_limb_in_place_mod(&mut ns, d), r);
        assert_eq!(ns, q);

        let mut ns = old_ns.to_vec();
        assert_eq!(_limbs_div_limb_in_place_mod_alt(&mut ns, d), r);
        assert_eq!(ns, q);

        let mut ns = old_ns.to_vec();
        assert_eq!(limbs_div_limb_in_place_mod_naive(&mut ns, d), r);
        assert_eq!(ns, q);
    };
    test(&[0, 0], 2, vec![0, 0], 0);
    test(&[6, 7], 1, vec![6, 7], 0);
    test(&[6, 7], 2, vec![0x8000_0003, 3], 0);
    test(
        &[100, 101, 102],
        10,
        vec![1_288_490_198, 858_993_469, 10],
        8,
    );
    test(&[123, 456], 789, vec![2_482_262_467, 0], 636);
    test(&[u32::MAX, u32::MAX], 2, vec![u32::MAX, 0x7fff_ffff], 1);
    test(&[u32::MAX, u32::MAX], 3, vec![0x5555_5555, 0x5555_5555], 0);
}

