#[cfg(feature = "32_bit_limbs")]
#[test]
fn test_limbs_div_limb_to_out_mod() {
    let test = |out_before: &[Limb], ns: &[Limb], d: Limb, r: Limb, out_after: &[Limb]| {
        let mut out = out_before.to_vec();
        assert_eq!(limbs_div_limb_to_out_mod(&mut out, ns, d), r);
        assert_eq!(out, out_after);

        let mut out = out_before.to_vec();
        assert_eq!(_limbs_div_limb_to_out_mod_alt(&mut out, ns, d), r);
        assert_eq!(out, out_after);

        let mut out = out_before.to_vec();
        assert_eq!(limbs_div_limb_to_out_mod_naive(&mut out, ns, d), r);
        assert_eq!(out, out_after);
    };
    test(&[10, 10, 10, 10], &[0, 0], 2, 0, &[0, 0, 10, 10]);
    test(&[10, 10, 10, 10], &[6, 7], 1, 0, &[6, 7, 10, 10]);
    test(&[10, 10, 10, 10], &[6, 7], 2, 0, &[0x8000_0003, 3, 10, 10]);
    test(
        &[10, 10, 10, 10],
        &[100, 101, 102],
        10,
        8,
        &[1_288_490_198, 858_993_469, 10, 10],
    );
    test(
        &[10, 10, 10, 10],
        &[123, 456],
        789,
        636,
        &[2_482_262_467, 0, 10, 10],
    );
    test(
        &[10, 10, 10, 10],
        &[u32::MAX, u32::MAX],
        2,
        1,
        &[u32::MAX, 0x7fff_ffff, 10, 10],
    );
    test(
        &[10, 10, 10, 10],
        &[u32::MAX, u32::MAX],
        3,
        0,
        &[0x5555_5555, 0x5555_5555, 10, 10],
    );
}

